var submitPass = document.getElementById('submitPass');
var passEl = document.getElementById('pass');
var invalidPassEl = document.getElementById('invalidPass');
var successEl = document.getElementById('success');
var contentFrame = document.getElementById('contentFrame');
function doSubmit(evt) {
try {
let decrypted = decryptDocument(passEl.value);
if (decrypted === "") throw "No data returned";
successEl.style.display = "inline";
passEl.disabled = true;
submitPass.disabled = true;
document.write(atob(encodeUnicode(decrypted)));
} catch (e) {
invalidPassEl.style.display = "inline";
passEl.value = "";
}
}
function encodeUnicode(str) {
return btoa(encodeURIComponent(str).replace(/%([0-9A-F]{2})/g,
function toSolidBytes(match, p1) {
return String.fromCharCode('0x' + p1);
}));
}
submitPass.onclick = doSubmit;
passEl.onkeypress = function(e){
if (!e) e = window.event;
var keyCode = e.keyCode || e.which;
invalidPassEl.style.display = "none";
if (keyCode == '13'){
// Enter pressed
doSubmit();
return false;
}
}
function decryptDocument(password) {
var message = embedded;
var salt = "6F67F53cc0534eA4778c25ce78eFAF9c";
var iv = "8165771e080F3c84b5cbD5cD754F83cF";
var key = CryptoJS.PBKDF2(password, CryptoJS.enc.Hex.parse(salt), {
keySize: 4,
iterations: 15000
});
var cipherParams = CryptoJS.lib.CipherParams.create({
ciphertext: CryptoJS.enc.Base64.parse(message)
});
var decrypted = CryptoJS.AES.decrypt(cipherParams, key, {
iv: CryptoJS.enc.Hex.parse(iv)
})
return decrypted.toString(CryptoJS.enc.Utf8);
}
